data.text:
@livamasy Bjr @livamasy, nous comprenons votre insatisfaction. Compte tenu des messages privés envoyés, nous avons demandé une prise en charge rapide de votre demande de remboursement par le service concerné. 
Nos conseillers de clientèle restent néanmoins à votre écoute si besoin. 
Merci

@ulidios Hola @ulidios, gracias por contactarnos. 
Hemos respondido a tu requerimiento a través de mensaje directo, agradecemos continuar la comunicación por la misma vía. 
Saludos.

@PeterHeathUK Bonjour @PeterHeathUK, nous faisons le maximum pour le confort de nos petits voyageurs et nous serions ravis de partager ce moment en vol avec vous. Le sujet est encore à l'étude mais nous ne manquerons pas de vous tenir informé. 
Merci  et bonne journée, 
Sandrine

@John60923531 @John60923531 pour tous les vols intra-Hexagone et Corse. 
Bonne journée, 
Sandrine

@Jonander_2 Hi @Jonander_2, if you're flying from France to Singapore, we invite you to check out the sanitary regulation on this page ➡https://t.co/itYFOD06eB
Have a good day. 
Sandrine

@allim75 Hi @allim75, please kindly find your request on our dedicated page ➡https://t.co/itYFOD06eB
Have a good day, 
Sandrine

@John60923531 @John60923531 les nouvelles dispositions ne s'appliquent pas aux voyages sur l'Ile de la Réunion. Si vous êtes vacciné, un schéma vaccinal complet + un test antigénique/PCR de -24h vous sera demandé. Plus d'infos par ici ➡ https://t.co/QbA9Mxoxxz. 
Bon vol, 
Sandrine

@nnnnsboules Bonjour @nnnnsboules, suite à la mise à jour des nouvelles règles sanitaires par les autorités françaises, le port du masque n'est plus obligatoire dans les aéroports et donc dans nos salons. 
Bon après-midi, 
Sandrine

@Cheick75Chekos Bonjour @Cheick75Chekos, les conditions de voyage de votre destination sont à retrouver sur la page dédiée https://t.co/TEXF2VCxFl. 
Bonne journée, 
Sandrine

@morvan_virginie Bonjour @morvan_virginie, nous sommes navrés pour ces délais de traitement. Votre message est pris en compte par nos équipes et vous serez assistée en DM dans la journée. 
Bon après-midi, 
Sandrine

@beduinenqueen Bonjour et merci de nous contacter via Twitter.
En effet, à ce jour, la liaison entre Paris CDG et Hanovre  n'est pas quotidienne.
Nous restons disponibles en MP.

@ToutAuPresent Bonjour Eric.
Nous vous remercions pour votre sympathique message ainsi que votre fidélité.
Découvrez les avantages du statut Flying Blue Gold via ce lien: https://t.co/7npumDYTTD

@Dezba Bonjour Dezba,
Nous allons vous assister.
Pouvez-vous nous en dire plus en DM ? Merci à vous

@hempdaddy73 Hi @hempdaddy73, we've passed on your message in order to get information about some connecting issues. 
Thank you. 
Sandrine

@PopBioethics Hi @PopBioethics, our customer support team has responded to your request. 
Please kindly get in touch with them. 
Thank you,  Sandrine

@AkudoDoris22 Hello @AkudoDoris22, we regret this incident at the arrival of your flight. Did you make your baggage claim via https://t.co/jOkOXO8vxg. 
We remain at your disposal in private in DM if needed. 
Have a good day, Sandrine

@PierreSDZ Bonjour @PierreSDZ, 
Afin de vous accompagner, pouvez-vous nous indiquer le n° de référence de votre dossier en DM s'il vous plait ? 
Nous vous remercions. Bonne journée, Sandrine

@moges_beyene Hi @moges_beyene, we follow up your request with our customer service. 
Have a good day, 
Sandrine
